	const [menus,getMenus]=useState('');
	const url = 'https:/localhost/motreats/api/process.php?get_menus='+1

	const getAllMenus=()=>{
		axios.get(url)
		.then((response)=>{
			const allMenus = response.data.products;
			getMenus(allMenus);
		})
		.catch(error=>console.error('Error: {error}'));
	}

  		return(
  			<>
  				<GetMenu menus={menus}/>
  				
			</>

